// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./CodeMavricksNft.sol";

contract CodeMavericksGouvernance is ReentrancyGuard, AccessControl {
    IERC20 public governanceToken;
    CodeMavricksNft public nftContract;
    bytes32 private constant CONTRIBUTOR_ROLE = keccak256("CONTRIBUTOR");
    bytes32 private constant STAKEHOLDER_ROLE = keccak256("STAKEHOLDER");
    uint32 immutable minimumVotingPeriod = 1 weeks;
    uint256 numOfProposals;
    uint256 public daoBalance;
    uint256 public stakeholderContribution;
    uint256 public minimumAmount = 1000;

    constructor(
        address _governanceToken,
        address _nftContract
    ) {
        governanceToken = IERC20(_governanceToken);
        nftContract = CodeMavricksNft(_nftContract);
    }

    struct Proposal {
        uint256 id;
        address proposer;
        uint256 amount;
        uint256 livePeriod;
        uint256 votesFor;
        uint256 votesAgainst;
        string title;
        string description;
        bool votingPassed;
        bool paid;
        address payable beneficiary;
        address paidBy;
    }

    mapping(uint256 => Proposal) private proposals;
    mapping(address => uint256) private contributors;
    mapping(address => uint256) private stakeholders;
    mapping(address => uint256[]) private stakeholderVotes;
    uint256 stakeholderCount;

    //Events
    event ContributionReceived(address indexed fromAddress, uint256 amount);
    event newProposal(address indexed proposer, uint256 amount);
    event PaymentTransfered(
        address indexed stakeholder,
        address indexed beneficiary,
        uint256 amount
    );
    event Voted(uint256 proposalId, address voter, bool inFavor);
    event ProposalExecuted(uint256 proposalId);

    //modifiers
    modifier onlyStakeholder(string memory message) {
        require(hasRole(STAKEHOLDER_ROLE, msg.sender), message);
        _;
    }

    modifier onlyContributor(string memory message) {
        require(hasRole(CONTRIBUTOR_ROLE, msg.sender), message);
        _;
    }

    function CreateProposal(
        string calldata title,
        string calldata description,
        address beneficiary,
        uint256 amount
    ) external {
        require(
            (hasRole(STAKEHOLDER_ROLE, msg.sender)) ||
                (nftContract.balanceOf(msg.sender) > 0)
        );
        uint256 proposalId = numOfProposals++;

        Proposal storage proposal = proposals[proposalId];
        proposal.id = proposalId;
        proposal.proposer = msg.sender;
        proposal.amount = amount;
        proposal.title = title;
        proposal.description = description;
        proposal.beneficiary = payable(beneficiary);
        proposal.livePeriod = block.timestamp + minimumVotingPeriod;

        emit newProposal(msg.sender, amount);
    }

    function voteWithNFT(uint256 proposalId, bool supportProposal) public {
        require(nftContract.balanceOf(msg.sender) > 0, "You do not own an nft");
        Proposal storage proposal = proposals[proposalId];

        handleVoting(proposal);
        if (supportProposal) proposal.votesFor += 1;
        else proposal.votesAgainst += 1;

        stakeholderVotes[msg.sender].push(proposal.id);
        emit Voted(proposalId, msg.sender, supportProposal);
    }

    function voteWithToken(
        uint256 proposalId,
        bool supportProposal
    ) public onlyStakeholder("Only stakeholders are allowed to vote") {
        Proposal storage proposal = proposals[proposalId];

        handleVoting(proposal);


        if (supportProposal) proposal.votesFor += 1;
        else proposal.votesAgainst += 1;
        stakeholderVotes[msg.sender].push(proposal.id);
        emit Voted(proposalId, msg.sender, supportProposal);
    }

    function handleVoting(Proposal storage proposal) private {
        require(proposal.id < numOfProposals, "Invalid proposal ID.");

        if (proposal.votingPassed || proposal.livePeriod <= block.timestamp) {
            proposal.votingPassed = true;
            revert("Voting period has passed on this proposal");
        }

        uint256[] memory tempVotes = stakeholderVotes[msg.sender];
        for (uint256 votes = 0; votes < tempVotes.length; votes++) {
            if (proposal.id == tempVotes[votes])
                revert("Double voting not allowed");
        }
    }

    function payBeneficiary(
        uint256 proposalId
    )
        external
        onlyStakeholder("Unauthorized: Stakeholders only")
        nonReentrant
        returns (uint256)
    {
        Proposal storage proposal = proposals[proposalId];
        require(daoBalance >= proposal.amount, "Insufficient fund");

        if (proposal.paid) revert("Payment sent before");

        if (proposal.votesFor <= proposal.votesAgainst)
            revert("Insufficient votes");

        bool success = governanceToken.transfer(
            proposal.beneficiary,
            proposal.amount
        );
        require(success, "Token transfer failed");

        proposal.paid = true;
        proposal.paidBy = msg.sender;
        daoBalance -= proposal.amount;

        emit PaymentTransfered(
            msg.sender,
            proposal.beneficiary,
            proposal.amount
        );

        return daoBalance;
    }

    function contribute(uint256 amount) external {
        //before we should approve this contract to spend the amount
        require(
            governanceToken.balanceOf(msg.sender) >= amount,
            "Insufficient balance"
        );
        governanceToken.transferFrom(msg.sender, address(this), amount);
        address account = msg.sender;
        uint256 amountContributed = amount;
        if (!hasRole(STAKEHOLDER_ROLE, account)) {
            uint256 totalContributed = contributors[account] +
                amountContributed;
            if (totalContributed >= minimumAmount) {
                stakeholders[account] = totalContributed;
                contributors[account] += amountContributed;
                _setupRole(STAKEHOLDER_ROLE, account);
                _setupRole(CONTRIBUTOR_ROLE, account);
                stakeholderCount++;
            } else {
                contributors[account] += amountContributed;
                _setupRole(CONTRIBUTOR_ROLE, account);
            }
        } else {
            contributors[account] += amountContributed;
            stakeholders[account] += amountContributed;
            stakeholderContribution += amountContributed;
        }
        daoBalance += amount;
    }

    //getters
    function getProposals() public view returns (Proposal[] memory) {
        Proposal[] memory props = new Proposal[](numOfProposals);

        for (uint256 i = 0; i < numOfProposals; i++) {
            props[i] = proposals[i];
        }
        return props;
    }

    function getProposal(
        uint256 proposalId
    ) public view returns (Proposal memory) {
        return proposals[proposalId];
    }

    function getNumberOfVotesFor(
        uint256 proposalId
    ) public view returns (uint256) {
        return proposals[proposalId].votesFor;
    }

    function getNumberOfVotesAgainst(
        uint256 proposalId
    ) public view returns (uint256) {
        return proposals[proposalId].votesAgainst;
    }

    function getStakeholderVotes()
        public
        view
        onlyStakeholder("User is not a stakeholder")
        returns (uint256[] memory)
    {
        return stakeholderVotes[msg.sender];
    }

    function getStakeholderBalance()
        public
        view
        onlyStakeholder("User is not a stakeholder")
        returns (uint256)
    {
        return stakeholders[msg.sender];
    }

    function getContributorBalance()
        public
        view
        onlyContributor("User is not a contributor")
        returns (uint256)
    {
        return contributors[msg.sender];
    }

    function isStakeholder() public view returns (bool) {
        return stakeholders[msg.sender] > 0;
    }

    function isContributor() public view returns (bool) {
        return contributors[msg.sender] > 0;
    }

    function getDaoBalance() external view returns (uint256) {
        return daoBalance;
    }
}
